using AssemblyLib.Utils;using System;using System.Collections.Generic;using System.Collections.ObjectModel;using System.Linq;using System.Text;using System.Threading.Tasks;namespace AssemblyLib.AssemblyModels{	public class RoofProjectionReinfPadModel : Notifier	{		public RoofProjectionReinfPadModel()		{					NPS = "";			OD = "";			DP = "";			HR = "";			DR = "";		}				private string _NPS;		public string NPS			{				get { return _NPS; }				set				{					_NPS = value;					OnPropertyChanged(nameof(NPS));				}			}				private string _OD;		public string OD			{				get { return _OD; }				set				{					_OD = value;					OnPropertyChanged(nameof(OD));				}			}				private string _DP;		public string DP			{				get { return _DP; }				set				{					_DP = value;					OnPropertyChanged(nameof(DP));				}			}				private string _HR;		public string HR			{				get { return _HR; }				set				{					_HR = value;					OnPropertyChanged(nameof(HR));				}			}				private string _DR;		public string DR			{				get { return _DR; }				set				{					_DR = value;					OnPropertyChanged(nameof(DR));				}			}			}}